        HS_Question: "I'm in High School, what should I know about birth control?",
        Barrier_Methods_Are: '\u{2022} Barrier methods include the male condom, female condom, and sponges with spermicide. \n\n\u{2022} Barrier methods of birth control block the sperm from going into the uterus or womb. If you are going to use a barrier method, using a spermicide with a barrier method gives you the best protection from getting pregnant. \n\n\u{2022} The spermicide kills most of the sperm that enter the vagina. \n\n\u{2022} The barrier method then blocks any remaining sperm from reaching the egg. \n\n\u{2022} Spermicides come as a foam, cream, jelly, film, or tablet. \n\n\u{2022} Barrier methods with spermicides are used only when you have sex. \n\n\u{2022} Barrier methods and water-base lubricants can be bought in a drug store. \n\n\u{2022} Be sure to read the instructions before using a barrier method. It is very important that you use a barrier method correctly every time you have sex. \n\n\u{2022} Male condom—Worn by the man, a male condom keeps sperm from getting into a woman’s body. Latex condoms are the most common type. They help prevent pregnancy, and HIV and other sexually transmitted diseases (STDs). The newer synthetic condoms also protect from STDs. “Natural” or “lambskin” condoms help prevent pregnancy. They may not protect against STDs, including HIV. \n\n\u{2022} Condoms can only be used once. Do not use oil-based lubricants such as massage oils, baby oil, lotions, or petroleum jelly with latex condoms. They will weaken the condom, causing it to tear or break. \n\n\u{2022} Female condom—Worn by the woman, the female condom helps keeps sperm from getting into her body. It can be put in up to eight hours before sex. \n\n\u{2022} Spermicides—These products work by killing sperm. They come in several forms—foam, gel, cream, film, suppository, or tablet. They are placed in the vagina no more than one hour before sex. You leave them in place at least six to eight hours after sex. You can use a spermicide with a male condom. \n\n\u{2022} Sponge with spermicide – This is a disk-shaped plastic device that is shaped like a disk with spermicide in it. It is put in the vagina before sex. It protects for up to 24 hours if left in place. You must leave the sponge in place for at least 6 hours after sex. It must be removed within 30 hours after it is put in place.',
        Male_or_female_condoms_are: '\u{2022} Male or female condoms are the only birth control methods that protect against sexually transmitted infections (STIs), including herpes and HIV (the virus that causes AIDS). \n\n\u{2022} To help protect yourself and your partner from getting or spreading a STI, be sure to use a condom every time you have sex.',
        bought_at_drug_stores: '\u{2022} Male condoms, female condoms, sponge with a spermicide, and all the different types of spermicides can be bought at drug stores.',
        protect_against_STDs: '"\u{2022}  Male or female condoms are the only birth control methods that protect against STDs, including HIV (the virus that causes AIDS) and herpes. \n\n\u{2022} Barrier methods do not affect a woman or mans future fertility. Barrier methods are a good choice if you are planning to become pregnant soon and prefer a method you can stop using anytime you want. \n\n\u{2022} Barrier methods are only used at the time of sex. Barrier methods are a good choice if you want an option that does not require hormones or insertion of an implant or intrauterine device (IUD). \n\n\u{2022} Barrier methods do not affect other health conditions such as high blood pressure. \n\n\u{2022} Barrier methods are less expensive than some of the other methods of birth control, and others you can get without a prescription. \n\n\u{2022} Barrier methods are a good choice if you are breast-feeding in addition to certain birth control pills',
        highest_pregnancy_rates: '\u{2022} Couples who use barrier methods have the highest pregnancy rates than if they used any other type of birth control. \n\n\u{2022} It must be used EVERY time you have intercourse. \n\n\u{2022} Some couples find barrier methods embarrassing to use or they do not want a barrier method to interrupt sex. \n\n\u{2022} The man or the woman may develop allergies to spermicides.',
        vary_in_their_ability: '\u{2022} Barrier methods of birth control vary in their ability to prevent pregnancy. They also vary in how effective they are at preventing STIs. \n\n\u{2022} Using a barrier method as birth control is not a good method for preventing pregnancy.',
