        there_were_no_birth_control_options_that_matched_your_preferences_please_reconsider_some_of_your_pre: 'No había ningún opción de anticoncepción que coinciden con sus preferencias. Por favor reconsidere algunas de sus preferencias sobre anticoncepción.',
        thinking_about_having_sex_you_may_feel_curious_interested_or_even_pressured_how_do_you_know_what_is_: '¿Esta pensando sobre tener sexo? Usted puede sentir curioso, interesado o incluso presionado. ¿Cómo se sabe lo que es correcto para usted? Aquí están algunas cosas a considerar: \n\n ¿Cuál es su conocimiento de temas sexuales, VIH, otras enfermedades de transmisión sexual y embarazo (incluyendo métodos de prevención)? \n\n ¿Está seguro de su habilidad individual para evitar el VIH/riesgo de ETS y las conductas de riesgo? ¿Qué sabe acerca de los condones y otros métodos de anticoncepción? ¿Se siente usted cómodo que podrá negarse a tener relaciones sexuales o usar los condones? \n\n ¿Cuáles son sus valores personales sobre el sexo y la abstinencia? \n\n ¿Está cómodo comunicando con sus padres u otros adultos sobre sexo, condones y anticonceptivos? (http://www.cdc.gov/teenpregnancy/about/index.htm) \n\n Buena toma de decisiones es un parte de convertirse un adulto, entonces es importante educarse a sí mismo y decida lo que es importante para usted. No es un secreto que el sexo puede ser divertido, y también es importante darse cuenta que hay ciertos riesgos asociados con sexo. La única manera de evitar completamente estos riesgos es no participar en cualquier tipo de actividad sexual (abstinencia). Sin embargo, si usted elige tener relaciones sexuales, la mejor cosa que hacer es entender estos riesgos y cómo evitarlos, para proteger su cuerpo y su futuro. Tiene mucho tiempo en su cuerpo, así tenga cuidado de usted. \n\n ¿Cuáles son estos riesgos? Aquí están algunos datos sobre los principales riesgos que implica el sexo; embarazo e infecciones de transmisión sexual. En Los Estados Unidos, 3 de cada 10 adolescentes (o 750.000 al año) se quedan embarazada al menos una vez antes de cumplir 20. Adolescentes que no usan un método de anticoncepción tienen un 90% oportunidad de quedar embarazada. De las adolescentes embarazadas, más de 50% nunca se graduarán de escuela secundaria y menos de 2% a obtener un título universitario antes de cumplir 30. 80% de los padres adolescentes no se casarán con la madre de su hijo. 2/3 de las madres adolescentes que van a vivir en pobreza y sobre la mitad se vuelven dependiente de bienestar. Los Estados Unidos tiene la tasa de embarazo adolescente más alta de cualquier otra nación industrializada. \n\n La buena noticia es en los últimos años las tasas de embarazo adolescente han disminuido gracias a adolescentes están mejor educados acerca del sexo. (https://www.dosomething.org/facts/11_facts_about_teen_pregnancy). \n\n 1 de cada 4 adolescentes sexualmente activos resulta infectada con una ETS cada año. Muchos adolescentes no se dan cuenta que estas infecciones pueden transmitirse a través de sexo oral así como las relaciones sexuales, que aumenta el riesgo. Los condones son el único método anticonceptivo que protege contra las ETS. Así que lo mejor es usar condones junto con otros métodos de control de la natalidad para protegerse mejor. \n\n ¿Cómo reducir los riesgos? Existen muchos tipos diferentes de anticoncepción. Encuentre uno que funcione para usted. Los mejores métodos de anticoncepción para adolescentes son los que son fácil de usar (o son ya en efecto) cada vez que tiene relaciones sexuales. Los métodos más fáciles y más confiables para anticoncepción son un anticonceptivo implante o dispositivo intrauterino (DIU). Se recomienda para los adolescentes y son reversibles. Cuando finalmente desea quedar embarazada, debe remover por un médico. Tener un implante o el DIU es sin complicaciones, ya que no tiene que tomar una pastilla diaria o cambiar un parche semanal o cambiar un anillo mensual. Un implante o el DIU es eficaz en la prevención de embarazo de 3_10 años, dependiendo de que tipo que elija. Uso de la pastilla, el parche o el anillo puede ser métodos fiables de anticoncepción si se usa correctamente. Realmente es la falla de usuario en lugar de la falta de método que se encarga de la mayoría de los embarazos que ocurren durante el uso de estos métodos. Por lo tanto, es importante, siga todas las instrucciones para usar el método que ha elegido. Los condones son el único método anticonceptivo que protege contra infecciones de transmisión sexual (ITS), incluyendo el herpes y el VIH (el virus que causa el SIDA). Uso del condón como anticonceptivo no es un método confiable para prevenir el embarazo. \n\n ¿Qué más puedo hacer? Edúquese sobre el funcionamiento de su cuerpo. Esperma masculina puede vivir en el cuerpo de la mujer hasta 5 días después del coito. Generalmente las mujeres sólo pueden quedar embarazadas durante la ovulación, que generalmente ocurre 14 días después del comienzo de cada período. Pero es posible que algunas mujeres ovulan más de una vez por mes, o tener ciclos que no siguen la regla de 14 días. Esto hace posible para algunas mujeres a quedar embarazada mientras está en su período. Muchas personas creen que posiciones sexuales diferentes pueden prevenir el embarazo. Pero la verdad es que la mujer puede quedar embarazada en cualquier posición. Conozca a su mismo. Sentimientos de deseo sexual son normales y pueden ser intensa y excitante, que a veces hace difícil mantenerse a salvo. No ceder a algo que le hace incomoda. Evitar situaciones donde le siente presionada a tener relaciones sexuales. Encuentre a un adulto que usted se siente comodo con que honestamente puede responder a sus preguntas sobre el sexo. Esta persona puede ser un padre u otro miembro de la familia o incluso alguien como un consejero, médico o enfermera. Elija a parejas sexuales que se preocupan por usted y respetan su salud y límites. \n\n\n\n',
        disclaimerButtonTitle: 'ESTE APLICACIÓN MÓVIL NO PROVEE CONSEJOS MÉDICOS. Para obtener información adicional, consulte nuestro Descargo de responsabilidad.',
        this_application_app_does_not_provide_specific_medical_advice_and_does_not_endorse_any_medical_or_pr: 'Este aplicación móvil no provee consejos médicos específicos y no promociona cualquier servicio medico o profesional obtenido a través de información o enlaces proporcionadas en esta aplicación. Está diseñado para ser utilizado como información general. El uso de esta aplicación no reemplaza una consulta médica con un profesional de salud calificado para satisfacer sus necesidades de salud o las necesidades de salud de los demás. Nunca ignore el consejo médico profesional cuando esta buscando tratamiento debido a algo usted ha leído en esta aplicación móvil. Si usted piensa que tiene una emergencia, por favor marque los números 911. A pesar de que el contenido de esta aplicación se actualiza periódicamente, información medica se cambia rápidamente. Entonces, alguna información puede ser anticuado y/o contiene inexactitudes o errores de tipográfico.',
