        protect_against_STDs: '\u{2022} Los preservativos masculinos o femeninos son los únicos métodos anticonceptivos que protegen contra las enfermedades de transmisión sexual, incluido el VIH (el virus que causa el SIDA) y el herpes. \n\n\u{2022} Los métodos de barrera no afectan a una mujer o fertilidad futura del hombre. Los métodos de barrera son una buena opción si planeas quedar embarazada pronto y prefieres un método que puedas dejar de usar cuando quieras. \n\n\u{2022} Los métodos de barrera solo se usan en el momento del sexo. Los métodos de barrera son una buena opción si desea una opción que no requiera hormonas o la inserción de un implante o dispositivo intrauterino (DIU). \n\n\n\u{2022} Los métodos de barrera no afectan otras condiciones de salud como la presión arterial alta . \n\n\u{2022} Los métodos de barrera son menos costosos que algunos de los otros métodos anticonceptivos, y otros pueden obtenerse sin receta médica. \n\n\u{2022} Los métodos de barrera son una buena opción si usted está amamantando además de ciertas píldoras anticonceptivas',
        highest_pregnancy_rates: '\u{2022} Las parejas que usan métodos de barrera tienen las tasas de embarazo más altas que si usaron algún otro tipo de método anticonceptivo. \n\n\u{2022} Debe usarse CADA vez que tenga relaciones sexuales. \n\n\u{2022} Algunas parejas encuentran que los métodos de barrera son vergonzantes de usar o no quieren un método de barrera para interrumpir el sexo. \n\n\u{2022} El hombre o la mujer pueden desarrollar alergias a los espermicidas',
